<script>
    //console.log($articles);

    // Select menu item
    var menuItems = document.getElementsByClassName('adminDashboardMenuItems');
    var contentItems = document.getElementsByClassName('adminDashboardContentItems');
    
    var menuPoll = document.getElementById('menuPoll');
    var menuDefis = document.getElementById('menuDefis');
    var menuConcours = document.getElementById('menuConcours');

    var challengesActionsButtons = document.getElementsByClassName('challengesActionsButtons');

    var createPollButton = document.getElementById('createPollButton');
    var createPoll = document.getElementById('createPoll');

    var listPollButton = document.getElementById('listPollButton');
    var listPoll = document.getElementById('listPoll');

    var createChallengeButton = document.getElementById('createChallengeButton');
    var createChallenge = document.getElementById('createChallenge');

    var listChallengeButton = document.getElementById('listChallengeButton');
    var listChallenge = document.getElementById('listChallenge');

    var showChallengeButton = document.getElementById('showChallengeButton');
    var showChallenge = document.getElementById('showChallenge');

    // on click, add active to menuPoll and remove active from others
    for (let i = 0; i < menuItems.length; i++) {
        menuItems[i].addEventListener('click', () => {
            for (let j = 0; j < menuItems.length; j++) {
                menuItems[j].classList.remove('active');
                contentItems[j].classList.remove('display');
            }
            menuItems[i].classList.add('active');
            contentItems[i].classList.add('display');
        })
    }

    // Set value to actual time
    window.addEventListener('load', () => {
        var now = new Date();
        now.setMinutes(now.getMinutes() - now.getTimezoneOffset());

        now.setMilliseconds(null)
        now.setSeconds(null)

        timers = document.querySelectorAll('.challenge_endTime');
        timers.forEach(element => {
            element.value = now.toISOString().slice(0, -1);
        });
    });

    // TEST SCRIPT POLL
    function ajouterOption() {
        var conteneurOptions = document.getElementById('conteneur-options');

        // Cr√©er un nouvel √©l√©ment de champ de texte
        var nouvelInput = document.createElement('input');
        nouvelInput.type = 'text';
        nouvelInput.name = 'options[]';
        nouvelInput.placeholder = 'Option';
        nouvelInput.classList.add('form', 'optionForm');

        // Ajouter le nouvel √©l√©ment au conteneur d'options
        conteneurOptions.appendChild(nouvelInput);
    }

    // V√©rifier si le champ de texte de l'option est vide
    var optionsVides = Array.from(conteneurOptions.querySelectorAll('input')).some(function(input) {
        return input.value.trim() === '';
    });

    if (!optionsVides) {
        conteneurOptions.appendChild(nouvelInput);
    } else {
        alert("Veuillez remplir toutes les options existantes avant d'en ajouter une nouvelle.");
    }


    function supprimerOption() {
        var conteneurOptions = document.querySelector('#conteneur-options');

        // V√©rifier s'il y a plus d'une option
        if (conteneurOptions.children.length > 1) {
            // Supprimer le dernier √©l√©ment de champ de texte
            conteneurOptions.removeChild(conteneurOptions.lastChild);
        }
    }
    //FIN TEST SCRIPT POLL
</script>
